webpackJsonp([0xfa9cb17969d5],{342:function(e,n){e.exports={data:{markdownRemark:{html:'<p>Once upon a midnight dreary, while I pondered, weak and weary,\nOver many a quaint and curious volume of forgotten lore—\nWhile I nodded, nearly napping, suddenly there came a tapping\nAs of some one gently rapping, rapping at my chamber door—\n"\'Tis some visitor," I muttered, "tapping at my chamber door—\nOnly this and nothing more."</p>',frontmatter:{title:"The Raven",date:"December 11, 2017",path:"/the-raven",tags:["poem","narrative","edgar allan poe","poe"],excerpt:"Only this and nothing more"}}},pathContext:{prev:{html:"<h4>a song by Gorillaz | Damon Albarn</h4>\n<p>Where does it come from? <br/>\nWhen everything was outside <br/>\nBusted and blue <br/>\nHow in the universe <br/>\nThrough the lithium <br/>\nBusted and blue <br/>\nI was asked by a computer <br/>\nA shadow on the wall <br/>\nAn image made by Virgil <br/>\nTo rule over us all <br/>\nTo amplify the sirens <br/>\nAnd to find real amends <br/>\nI'm through the echo-chambers <br/>\nTo other worlds away <br/>\nAll my life <br/>\nAll my life <br/>\nBeam a light <br/>\nOn me, I am a satellite <br/>\nAnd I can't get back without you <br/>\nBe my love <br/>\nBe my love <br/>\nBe my love <br/>\nBe my love <br/>\nWhere do they come from? <br/>\nThe wires that connect to us <br/>\nWeightless and fall on your body <br/>\n'Till we're invisible <br/>\nI'm with you throughout it, choose <br/>\nBusted and blue <br/>\nAll my life <br/>\nAll my life <br/>\nBeam a light <br/>\nOn me, I am a satellite <br/>\nAnd I can't get back without you <br/>\nBe my love <br/>\nBe my love <br/>\nBe my love <br/>\nBe my love <br/>\nBusted and blue <br/></p>",id:"/Users/fernandomendoza/Proyectos/my-blog/src/pages/2017-12-11-busted-and-blue/index.md absPath of file >>> MarkdownRemark",frontmatter:{date:"2017-12-12T03:33:49+00:00",path:"/busted-and-blue",title:"Busted and Blue",excerpt:"And I can't get back without you",tags:["gorillaz","damon albarn","busted","blue"]}},next:{html:'<ol>\n<li><strong>Rename your local branch</strong></li>\n</ol>\n<p>If you are on the branch you want to rename</p>\n<pre><code class="language-bash">git branch -m new-name\n</code></pre>\n<p>If you are on a different branch</p>\n<pre><code class="language-bash">git branch -m old-name new-name\n</code></pre>\n<ol start="2">\n<li><strong>Delete the old-name remote branch and push the new-name local branch</strong></li>\n</ol>\n<pre><code class="language-bash">git push origin :old-name new-name\n</code></pre>\n<ol start="3">\n<li><strong>Reset the upstream branch for the new-name local branch</strong></li>\n</ol>\n<pre><code class="language-bash">git push origin -u new-name\n</code></pre>',id:"/Users/fernandomendoza/Proyectos/my-blog/src/pages/2017-12-12-rename-local-and-remote-branch-git/index.md absPath of file >>> MarkdownRemark",frontmatter:{date:"2017-12-12T01:19:07+00:00",path:"/rename-local-and-remote-branch-git",title:"Rename a local and remote branch in git",excerpt:"",tags:["git","branch","branch names"]}}}}}});
